  'AdminAdvparametersHelp' => 
  array (
    'or' => 'atau',
    'A category root is where a category tree can begin. This is used with multistore.' => 'Kategori root adalah kategori dengan level teratas, biasanya digunakan pada multistore.',
    '0 = Use quantity set in product, 1 = Use quantity from warehouse.' => '0 = Gunakan stok dari produk, 1 = Gunakan stok dari gudang.',
    'ID of the warehouse to set as storage.' => 'ID gudang yang digunakan sebagai penyimpanan.',
    'Use this option to associate data (products, modules, etc.) the same way for each selected shop.' => 'Gunakan opsi ini untuk mengasosiasikan data (produk, modul, dll) di masing-masing toko.',
