    'Click here to display the list of shop groups' => 'Klik disini untuk menampilkan daftar grup toko',
    'Warning: Enabling the "share customers" and "share orders" options is not recommended. Once activated and orders are created, you will not be able to disable these options. If you need these options, we recommend using several categories rather than several shops.' => 'Perhatian: Mengaktifkan "bagikan pelanggan" dan "bagikan pembelian" tidak direkomendasikan. Karena setelah diaktifkan dan pembelian dibuat, fitur ini tidak dapat dinonaktifkan. Jika Anda memerlukan opsi ini, disarankan untuk menggunakan beberapa kategori daripada beberapa toko.',
