    'Warning: you will not be able to disable this option once you have registered customers.' => 'Perhatian: Anda tidak akan dapat menonaktifkan opsi setelah ada pelanggan yang mendaftar.',
    'Once this option is enabled (which is only possible if customers and available quantities are shared among shops), the customer\'s cart will be shared by all shops in this group. This way, any purchase started in one shop will be able to be completed in another shop from the same group.' => 'Setelah opsi ini aktif (jika data pelanggan dan stok dibagi diantara toko lainnya), cart pelanggan akan dibagi ke semua toko di grup ini. Dengan demikian, pembelian yang dilakukan di satu toko akan dapat diselesaikan di toko lainnya pada grup yang sama.',
    'Warning: You will not be able to disable this option once you\'ve started to accept orders.' => 'Perhatian: Anda tidak akan dapat menonaktifkan opsi setelah ada pembelian.',
    'Enable or disable this shop group?' => 'Aktif atau nonaktifkan grup toko ini?',
    'If you want to add a virtual URL, you need to activate URL rewriting on your web server and enable Friendly URL option.' => 'Jika akan menambahkan virtual URL, Anda harus mengaktifkan URL rewriting di server Anda dan mengaktifkan opsi friendly URL.',
    'You can use this option if you want to create a store with a URL that doesn\'t exist on your server (e.g. if you want your store to be available with the URL www.example.com/my-store/shoes/, you have to set shoes/ in this field, assuming that my-store/ is your Physical URL).' => 'Anda dapat menggunakan opsi ini jika akan membuat toko dengan URL yang belum ada (misalnya buat toko dengan URL www.example.com/my-store/shoes/, maka Anda harus mengeset shoes/ pada field, dengan catatan my-store/ adalah URL fisik).',
    'URL rewriting must be activated on your server to use this feature.' => 'URL rewriting harus aktif agar fitur ini dapat digunakan.',
    'If you set this URL as the Main URL for the selected shop, all URLs set to this shop will be redirected to this URL (you can only have one Main URL per shop).' => 'Jika Anda set URL ini sebagai URL utama, semua URL yang telah diset di toko ini akan diredirect ke URL utama ini (hanya satu URL utama yang dapat aktif per toko).',
