    'This is the physical folder for your store on the web server. Leave this field empty if your store is installed on the root path. For instance, if your store is available at www.example.com/my-store/, you must input my-store/ in this field.' => 'Direktori fisik toko Anda di web server. Kosongkan field ini jika toko Anda diinstall di root. Misalnya, jika toko Anda berada di www.example.com/my-store/, Anda harus mengisi my-store/.',
