    'Public title for the product\'s page, and for search engines. Leave blank to use the product name. The number of remaining characters is displayed to the left of the field.' => 'Nama publik untuk halaman produk dan mesin pencari. Kosongkan jika akan menggunakan nama produk. Angka pada sisa karakter akan ditampilkan dikiri field.',
