    'Search ref.' => 'Ref. pencarian',
    'Save the product and stay on the current page: ALT+SHIFT+S' => 'Simpan produk dan tetap di halaman ini: ALT+SHIFT+S',
    'Permanently delete this product.' => 'Hapus produk ini secara permanen.',
    'See how your product sheet will look online: ALT+SHIFT+V' => 'Lihat tampilan lembar produk secara daring: ALT+SHIFT+V',
    'Enable or disable the product on your shop: ALT+SHIFT+O' => 'Aktifkan atau nonaktifkan produk di toko: ALT+SHIFT+O',
    'Save and duplicate this product, then go to the new product: ALT+SHIFT+D' => 'Simpan dan duplikasikan produk ini, lalu kunjungi produk baru: ALT+SHIFT+D',
