    'If you want a category to appear in the menu of your shop, go to [1]Modules > Module Manager[/1] and configure your menu module.' => 'Jika Anda ingin sebuah kategori untuk muncul dalam menu di toko Anda, masuk ke [1]modul > modul manajer.[/1] kemudian, konfigurasi modul menu Anda.',
    'This is the main image for your category, displayed in the category page. The category description will overlap this image and appear in its top-left corner.' => 'Inilah gambar utama untuk kategori Anda yang ditampilkan di laman kategori. Keterangan kategori akan ditampilkan pada pojok kiri atas gambar.',
    'Displays a small image in the parent category\'s page, if the theme allows it.' => 'Tampilkan gambar kecil di halaman kategori induk, jika diperbolehkan oleh tema.',
    'The category thumbnail appears in the menu as a small image representing the category, if the theme allows it.' => 'Kategori muncul di menu berupa gambar kecil yang mewakili kategori, jika dibolehkan tema.',
