  'AdminDesignHelp' => 
  array (
    'By default, all images settings are already installed in your store. Do not delete them, you will need it!' => 'Secara standar, semua pengaturan gambar sudah dipasang di toko Anda. Jangan menghapusnya, Anda akan membutuhkannya!',
    'Select "No" only if your server timed out and you need to resume the regeneration.' => 'Pilih "Tidak" hanya jika server Anda time out dan Anda perlu meneruskan kembali proses pembuatan gambar.',
    'Please select a module' => 'Silahkan pilih modul',
    'Select a module above before choosing from available hooks' => 'Pilih modul diatas sebelum memilih hook yang tersesia',
    'Please specify the files for which you do not want the module to be displayed.' => 'Silakan tentukan file-file yang Anda tidak ingin modul yang akan ditampilkan',
    'Please input each filename, separated by a comma (",").' => 'Silahkan input masing-masing nama file, dipisahkan oleh koma (",").',
    'You can also click the filename in the list below, and even make a multiple selection by keeping the Ctrl key pressed while clicking, or choose a whole range of filename by keeping the Shift key pressed while clicking.' => 'Anda dapat memilih pada daftar file dibawah dengan satu klik, atau membuat beberapa pilihan sekaligus dengan menekan tombol Ctrl+klik, atau memilih sekaligus dengan menekan tombol Shift+klik.',
    'JPEG images have a small file size and standard quality. PNG images have a larger file size, a higher quality and support transparency. Note that in all cases the image files will have the .jpg extension.' => 'Gambar JPEG memiliki ukuran file kecil dan kualitas standar. Gambar PNG memiliki ukuran file yang lebih besar, kualitas yang lebih tinggi dan transparansi dukungan. Perhatikan bahwa dalam semua kasus file gambar akan memiliki ekstensi. Jpg.',
