    'Ranges from 0 (worst quality, smallest file) to 100 (best quality, biggest file).' => 'Berkisar dari 0 (terburuk kualitas, file terkecil) untuk 100 (kualitas terbaik, file terbesar)',
    'Recommended: 90.' => 'Direkomendasikan: 90.',
    'PNG compression is lossless: unlike JPG, you do not lose image quality with a high compression ratio. However, photographs will compress very badly.' => 'Kompresi PNG adalah lossless: tidak seperti JPG, Anda tidak kehilangan kualitas gambar pada rasio kompresi yang tinggi. Akan tetapi, foto akan dikompress secara tidak sempurna.',
    'Ranges from 0 (biggest file) to 9 (smallest file, slowest decompression).' => 'Berkisar antara 0 (ukuran file terbesar) sampai 9 (ukuran file terkecil, proses dekompresi lebih lambat).',
