    'This will generate an additional file for each image (thus doubling your total amount of images). Resolution of these images will be twice higher.' => 'Hal ini akan membuat tambahan file untuk masing-masing gambar (dan akan menambah total jumlah gambar). Resolusi gambar ini akan dua kali lebih tinggi.',
