    'URL rewriting (mod_rewrite) is not active on your server, or it is not possible to check your server configuration. If you want to use Friendly URLs, you must activate this mod.' => 'URL rewriting (mod_rewrite) tidak aktif di server Anda, atau Prestashop gagal melakukan cek konfigurasi server. Jika akan menggunakan Friendly URL, mod ini harus diaktifkan.',
