  'AdminShopparametersNotification' => 
  array (
    'Caution: The discount applied to a category does not stack with the overall reduction but instead replaces it.' => 'Perhatian: Diskon yang diterapkan pada kategori tidak ditotal dengan potongan harga lainnya (hanya diskon ini yang berlaku).',
    'Only products that have this category as the default category will be affected.' => 'Hanya berpengaruh kepada produk dalam kategori ini.',
    'You cannot delete this shop (customer and/or order dependency)' => 'Anda tidak bisa menghapus toko ini (kebergantungan pelanggan dan/atau pesanan)',
    'Click here to set a URL for this shop.' => 'Klik disini untuk set URL untuk toko ini.',
    'Width and height must be numeric values.' => 'Lebar dan tinggi harus nilai numerik',
    'The discount value is incorrect (must be a percentage).' => 'Nilai diskon salah (harus persentase).',
    'Wrong category ID.' => 'ID Kategori salah.',
    'The discount value is incorrect.' => 'Nilai diskon salah',
    'You cannot save group reductions.' => 'Grup diskon tidak dapat disimpan.',
    'An error occurred while updating this group.' => 'Terjadi error pada saat mengupdate grup.',
    'Aliases and results are both required.' => 'alias dan hasilnya keduanya diperlukan',
    'Is not a valid result' => 'bukan hasil yang valid',
    'Is not a valid alias' => 'bukan alias yang valid',
    'This is not a valid IP address:' => 'Ini tampaknya bukan alamat IP:',
    'You cannot delete this shop (customer and/or order dependency).' => 'Anda tidak bisa menghapus toko ini (kebergantungan pelanggan dan/atau pesanan).',
    'Please create some sub-categories for this root category.' => 'Harap buat beberapa sub kategori untuk kategori root ini.',
    'You need to select at least the root category.' => 'Anda harus memilih kategory root.',
    'Warning: You won\'t be able to change the group of this shop if this shop belongs to a group with one of these options activated: Share Customers, Share Quantities or Share Orders.' => 'Warning: you won\'t be able to change the group of this shop if this shop belongs to a group with one of these options activated: Share Customers, Share Quantities or Share Orders',
    'You can only move your shop to a shop group with all "share" options disabled -- or to a shop group with no customers/orders.' => 'Anda hanya dapat memindahkan toko kedalam grup toko dimana opsi "Share" nonaktif -- atau kedalam grup toko yang belum ada data pelanggan/pembelian.',
    'For security reasons, you cannot delete default order statuses.' => 'Demi keamanan, anda tidak dapat menghapus status pembelian default',
    'An address located in a country containing states must have a state selected.' => 'Alamat di negara yang memerlukan propinsi harus memiliki propinsi yang perlu diset.',
    'Latitude and longitude are required.' => 'Lintang dan bujur diperlukan.',
    'The specified state is not located in this country.' => 'Propinsi tidak ditemukan di negara ini.',
    'Before being able to use this tool, you need to:' => 'Sebelum dapat menggunakan fitur ini, Anda harus:',
    'Create a blank .htaccess in your root directory.' => 'Buat file .htaccess kosong di root direktori.',
    'Give it write permissions (CHMOD 666 on Unix system).' => 'Berikan hak tulis (CHMOD 666).',
    'You must define an SMTP server and an SMTP port. If you do not know it, use the PHP mail() function instead.' => 'Server dan port SMTP harus diisi. Jika Anda tidak tahu, gunakan fungsi PHP mail().',
    'Assign a valid page if you want it to be read.' => 'Set halaman CMS yang valid untuk dibaca.',
    'Your robots.txt file MUST be in your website\'s root directory and nowhere else (e.g. http://www.example.com/robots.txt).' => 'File robots.txt harus berada di root direktori website Anda (misalnya. http://www.yoursite.com/robots.txt).',
    'Generate your "robots.txt" file by clicking on the following button (this will erase the old robots.txt file)' => 'Buat "robots.txt" dengan klik tombol dibawah (isi robots.txt sebelumnya akan dihapus)',
    'Before you can use this tool, you need to:' => 'Sebelum menggunakan fitur ini, sebaiknya Anda:',
    '1) Create a blank robots.txt file in your root directory.' => '1) Buat file robots.txt kosong di direktori root.',
    '2) Give it write permissions (CHMOD 666 on Unix system).' => '2) Berikan hak tulis (CHMOD 666 di sistem UNIX).',
    'The multistore option is enabled. If you want to change the URL of your shop, you must go to the "Multistore" page under the "Advanced Parameters" menu.' => 'The multistore option is enabled. If you want to change the URL of your shop, you must go to the \\"Multistore\\" page under the \\"Advanced Parameters\\" menu.',
    'Here you can set the URL for your shop. If you migrate your shop to a new URL, remember to change the values below.' => 'Disini Anda dapat mengatur URL untuk toko Anda. Jika toko Anda menggunakan URL yang berbeda harap ubah pada isian dibawah ini.',
    'This section enables you to change the default pattern of your links. In order to use this functionality, PrestaShop\'s "Friendly URL" option must be enabled, and Apache\'s URL rewriting module (mod_rewrite) must be activated on your web server.' => 'Dibagian ini Anda dapat mengubah pola tautan Anda. Agar fungsi ini dapat bekerja, opsi "Friendly URL" harus diaktifkan, dan modul URL rewriting Apache  (mod_rewrite) harus diaktifkan di server Anda.',
